  .checkbox + label {
    position: relative;

    width: 100%;

    display: flex;
    align-items: center;
    font-size: 1.7rem;


    cursor: pointer;
    padding-right: 50px;
  }

  .checkbox + label:before {
    content: "";
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    right: 0;
    width: 45px;
    height: 20px;
    border-radius: 15px;
    background: #CDD1DA;
    box-shadow: inset 0 2px 3px rgba(0, 0, 0, 0.2);
